from BaseClasses import ItemClassification as IC
from typing import NamedTuple, Dict, Set, List
from enum import IntEnum

class ItemType(IntEnum):
    tech = 1
    building = 2
    unit = 3
    goal = 4
    filler = 5
    progression = 6


class ItemData(NamedTuple):
    classification: IC
    count: int
    name: str
    type: ItemType
    faction: str
    tier: int
    progressionGroup: str

